body {
    font-family: 'Open Sans', sans-serif;
    font-weight: 300;
    margin: 0;
    padding: 0;
}

h1, h2, h3, h4, h5, h6 {
 font-family: 'Archivo', sans-serif;
 font-weight: 500;
}

.Title {
    display: flex;
    font-family: 'Quicksand', sans-serif, bold;
    align-content: center;
    justify-content: flex-start;
    width: 100%;
    color: orange;
    padding-top: 2rem;
    font-size: 4rem;
    margin-bottom: 1rem;
    padding-left: 3rem;
}

.seprator {
  width: 69%;
  margin:0 3rem;
}

.blocks {
    display: grid;
    grid-template-columns: repeat(3, 1fr);
    row-gap: 2rem;
    column-gap: 1rem;
    padding-top: 2rem;
    padding-left: 2rem;
    padding-right: 2rem;
}

.block {
    display: flex;
    margin-left: 1rem;
    margin-right: 1rem;
    justify-content: center;
    align-items: center;
    /* border: 3px solid black; */
    border-radius: 10px;
    height: 15rem;
    width: auto;
    box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19);
    background-color: EEEEEE;
}

.popup-box {
    position: fixed;
    background: #00000050;
    width: 100%;
    height: 100vh;
    top: 0;
    left: 0;
  }

  .box {
    position: relative;
    width: 70%;
    margin: 0 auto;
    height: 50%;
    max-height: 70vh;
    margin-top: calc(100vh - 85vh - 20px);
    background: #fff;
    border-radius: 10px;
    padding: 20px;
    border: 1px solid #999;
    overflow: auto;
  }

  .close-icon {
    content: 'x';
    cursor: pointer;
    position: fixed;
    right: calc(15% - 30px);
    top: calc(100vh - 85vh - 33px);
    background: #ededed;
    width: 25px;
    height: 25px;
    border-radius: 50%;
    line-height: 20px;
    text-align: center;
    border: 1px solid #999;
    font-size: 20px;
  }

.navBar {
  overflow: hidden;
  position: fixed;
  width: 100vw;
  top: 0;
  padding: 0;
  margin: 0;
  list-style-type: none;
  background-color: white;
  height: auto;
  box-shadow: 1px 1px 5px rgba(0,0,0,.5);
  z-index: 1;
}

.navBar li{
  float: left;
}

.navBar a {
  cursor: pointer;
  font-size: 1.1rem;
  display: block;
  text-align: center;
  padding: 14px 16px;
  color: black;
  text-decoration: none;
}

.navBar a:hover:not(.active) {
  background-color: orange;
  color: white;
}

.navBar a:active {
  color: orange;
}

.HomePage {
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: orange;
  height: 60rem;
  width: 100%;
}

.react-rotating-text-cursor {
  animation: blinking-cursor 0.8s cubic-bezier(0.68, 0.01, 0.01, 0.99) 0s infinite;
}

@keyframes blinking-cursor {
  0% {
    opacity: 0;
  }
  50% {
    opacity: 1;
  }
  100% {
    opacity: 0;
  }
}

.welcome {
  color: white;
  font-size: 5rem;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
}

.introdution {
  display: flex;
  background-color: white;
  width: 100%;
  height: 30rem;
}

.summaryTitle {
  margin-top: 15rem;
  margin-left: 10%;
  font-size: 2rem;
}

.Image {
  float: right;
}

.IntroText {
  font-size: 20px;
  margin-left: 12%;
  margin-right: 60%;
  margin-top: 5rem;
  margin-bottom: 30rem;
}

.active {
  background-color: orange;
  color:white !important;
}


.Balance-Circle {
  display: flex;
  align-items: center; 
  justify-content: center;
  border-radius: 50%;
  background-color: orange;
  height: 25rem;
  width: 25rem;
  margin-left: 37%;
  margin-right: 50%;
  margin-top: 5%;
  box-shadow: 2px 1px 5px rgba(0,0,0,.8);
}

.balance {
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: white;
  border-radius: 50%;
  height: 20rem;
  width: 20rem;
  font-family: Impact, Haettenschweiler, 'Arial Narrow Bold', sans-serif;
  font-size: 5rem;
  color: orange;
  box-shadow: 2px 1px 5px rgba(0,0,0,.8);
}

.backButton {
  display: inline-block;
  text-decoration: none;
  margin: 1rem;
  width: 3rem;
  height: 3rem;
  font-size: 2rem;
  background-color: orange;
  border-radius: 30%;
  color: white;
  box-shadow: 1px 1px 5px rgba(0,0,0,.8);
}

.Wallet-body {
  height: 100vh;
}

.Min-title {
  font-family: Impact, Haettenschweiler, 'Arial Narrow Bold', sans-serif;
  padding-left: 60%;
  font-size: 2rem;
  color: orange;
}

.header {
  width: 100%;
  background-color: grey;
}

.send-button {
  position: relative;
  display: inline-block;
  width: 20rem;
  height: 5rem;
  color: white;
  border-radius: 10px;
  margin-top: 15rem;
  margin-left: 15%;
  background-color: rgb(52, 189, 89);
  box-shadow: 1px 1px 5px rgba(0,0,0,.8);

}

.recieve-button {
  display: inline-block;
  width: 20rem;
  height: 5rem;
  color: white;
  border-radius: 10px;
  margin-top: 15rem;
  margin-left: 30%;
  background-color: rgb(255, 69, 58);
  box-shadow: 1px 1px 5px rgba(0,0,0,.8);
}

.btn-text {
  display: flex;
  font-family: 'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif;
  font-size: 2rem;
  justify-content: center;
  align-items: center;
  height: inherit;
  text-decoration: none;
  color: white;
}

.copy-btn {
  font-size: 1.2rem;
  width: 6rem;
  height: 2rem;
  display: inline-block;
  background-color: orange;
  color: white;
  /* border:none */
}

.Qr-Code {
  margin-left: 40%;
  margin-right: 50%;
  margin-top: 10rem;
  margin-bottom: 4rem;
}

.address-holder {
  margin-left: 20%;
  margin-right: 3rem;
  display: inline-block;
  height: 2rem;
}


.ConductTransaction {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 35vh;
}

.form-group {
  font-size: 2rem;
  height: 5rem;
  margin-left: 5%;
  width: 90%;
}

.form-control {
  font-size: 2rem;
  height: 5rem;
  width: 90%;
}

.SeTitle {
  margin-left: 46%;
  margin-bottom: 2rem !important;
  font-family: 'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif;
  font-size: 3rem;
  color: orange;
}

.btn {
  position: absolute;
  font-size: 2rem;
  font-family: 'Franklin Gothic Medium', 'Arial Narrow', Arial, sans-serif;
  background-color: orange;
  color: white;
  box-shadow: 1px 1px 5px rgba(0,0,0,.8);
  margin-top: 16%;
  margin-left: 20%;
  height: 1.5em;
  width: 60%;
  border-color: orange;
}

.PublicNote-Starter {
  display: flex;
  justify-content: center;
  align-items: center;
  position: absolute;
  background-color: orange;
  color: white;
  width: 50%;
  height: 100%; 
}

.PrivNote-Starter {
  display: flex;
  justify-content: center;
  align-items: center;
  position: absolute;
  background-color: #21cec8;
  color: white;
  width: 50%;
  height: 100%;
  margin-left: 50%;
}

.PublicNote-Starter:hover {
  background-color: #e69500;
  box-shadow: 1px 1px 5px rgba(0,0,0,.8);
}

.PrivNote-Starter:hover {
  background-color: #1db8b3;
  box-shadow: 1px 1px 5px rgba(0,0,0,.8);
}

.mini {
  color: #3D3D3D;
  font-size: 12px;
}

.Notes {
  display: grid;
  width: 100%;
  grid-template-columns: repeat(1, 1fr);
  row-gap: 2rem;
  column-gap: 1rem;
}

.mini-text {
  display: inline;
  font-size: 1rem;
}

.note-sep {
  width: 100%;
  margin-top: 2rem;
  margin-bottom: 2rem;
}

.AddButton {
  margin-left: 90%;
}

.pageNav {
  color: white;
  background-color: orange;
}

.holder {
  margin-left: 2px;
}
